/**forgotpass.js**/
/**js used in forgot pass functionality**/

$(function($){

	//forgot password
	$('.forgot-pass-link').click( ForgotPassword.toggle );

    // Hide the location box, if clicked outside the location box.
    $( "body" ).click( ForgotPassword.clickedOutside );

    $('.login .send_password .close').click( ForgotPassword.close );

    //
    $("#forgotPasswordMail").click( ForgotPassword.sendMail );

});

// Create a HeaderLocation class.
var ForgotPassword =
{
    toggle : function( e ) {

        $('.send_password').toggle();
        e.preventDefault();
    },

    clickedOutside : function( e ) {

        var container = $(".send_password, .form-links-container .form-links, .forgot-pass-link");
        if( !container.is( e.target ) && container.has( e.target ).length === 0 )
        {
            $(".send_password").hide();
        }
    },

    close : function( e ) {

        $('.send_password').hide();
        e.preventDefault();
    },

    sendMail : function( e ){

        var email = $(this).parents(".send_password").find("input[type=text]").val();
        $("#forgot_btn").hide();
        $("#forgot_img").show();
        $.ajax({
            type: "POST",
            url: "/forgot-password",
            datatype: "text",
            data: { emailID : email },
            cache: false,
            success: function( result ) {
                $("#forgot_btn").show();
                $("#forgot_img").hide();
                $("#forgotPasswordMessage").html( result );
            }

        });
        return false;

    }

}

