	var lastName = '';
	var subject = '';
	var agent = '';
	var bookedAMCAT = -1;
	var contactUsing = -1;
	var defaultChatMsg = 'May I help you?';
	
            /*
             * @funtion get cookie value
             * @param {string} c_name (cookie name)
             * @returns {string} y (cookie value)
             */
	function getCookie(c_name)
	{
            var i,x,y,ARRcookies=document.cookie.split(";");
            for (i=0;i<ARRcookies.length;i++)
              {
              x=ARRcookies[i].substr(0,ARRcookies[i].indexOf("="));
              y=ARRcookies[i].substr(ARRcookies[i].indexOf("=")+1);
              x=x.replace(/^\s+|\s+$/g,"");
              if (x==c_name)
                    {
                    return unescape(y);
                    }
              }
	}

            /*
             * @funtion delete cookie 
             * @param {string} c_name (cookie name)
             * @returns {unresolved}
             */
	function delCookie(c_name) {
            document.cookie = encodeURIComponent(c_name) + "=deleted; expires=" + new Date(0).toGMTString();
	}
	
            /*
             * @funtion set cookie
             * @param {string} c_name (cookie name) , {string} value (cookie value) , {number} exMins
             * @returns {unresolved}
             */
	
	function setCookies(c_name,value,exMins)
	{
            var exdate=new Date();
            exdate.setMinutes(exdate.getMinutes() + exMins);
            var c_value=escape(value) + ((exMins==null) ? "" : "; expires="+exdate.toGMTString());
            document.cookie=c_name + "=" + c_value;
	}
            /*
             * @funtion get different cookie status
             * @param {string} c_name (cookie name) 
             * @returns {unresolved}
             */
	function checkCookie(c_name)
	{
		var c_name_status=getCookie(c_name);
                    //if booked amcat cookie is already status
		if (c_name == "bookedAMCAT") 
                {
			if (c_name_status == undefined)
				return -1;
			else
			return c_name_status;
		}   //if chat count cookie set , return value if exist other wise 0
                else if (c_name == "chatCount") 
                {
			if(c_name_status >= 0)
				return c_name_status;
			else if(c_name_status == "undefined")
				return 0;
			else 
				return 0;
		}   // check if form already appeared , if yes do not show form again
                else if (c_name == "chatFormAppears") 
                {
			if(c_name_status >0)
				return c_name_status;
			else if(c_name_status == "undefined")
				return 0;
			else 
				return 0;
			
		}   
                else if (c_name == "index_bookedAMCAT") 
                {
			if (c_name_status == undefined)
				return -1
			else
			return c_name_status;
		} 
		return 0;
	}

        /*
         * @function called automatically on-load
         * set chatcount to 1 
         * if candidate has filled email us 
         * @returns {undefined}
         */
	
	function checkChatStatus()
        {
		var c_name_status = 0;
		c_name_status = checkCookie("chatCount");
                
                    //if chat is already done
		if (c_name_status > 1) {
			
                        $('.live_chat_button').show();
		} 
                    //when chat with us form is filled , but due to any reason chat is not started, then this condition executes
		if ((checkCookie("bookedAMCAT") == 1 || checkCookie("bookedAMCAT") == 0) && c_name_status == 1) {
                        $('.live_chat_button').hide();
			enableChatWindow(checkCookie("bookedAMCAT"), defaultChatMsg);
		}
                
	}
	

